INSERT INTO `documents` VALUES (1, 'Karena menjadi pribadi yang memiliki sifat jujur merupakan hal yang sangat penting, selain menjadikan kita sebagai orang yang dapat dipercaya juga akan mengantarkan kita ke Surga. Selain itu orang yang jujur terhindar dari golongan pendusta yang balasannya adalah Neraka.', 'd9');
INSERT INTO `documents` VALUES (17, 'menjadi pribadi bersifat jujur merupakan hal penting karena akan mengantarkan kita ke surga, dan terhindar jujur dari golongan pendusta', 'd9');
INSERT INTO `documents` VALUES (18, 'Bila berkata-kata tidak berdusta/berbohong. memiliki sifat jujur jujur', 'd9');
